So excited to be showing my work alongside these and more amazing Asian artists as part of the @creativoofficial @shareyourasianstory event “Dreams of the Dragon” on March 22nd in LA. 

The “Dreams of the Dragon” three-part series will showcase the talent of various Asian artists and creatives from a broad range of fields, such as music, fashion, art, film, and more. The series aims to celebrate the profound depth and impact of Asian culture on the American landscape.

The initial event is scheduled to take place at a private mansion situated in the Hollywood Hills on March 22, 2023, during NFT LA. The second event will follow on April 13, 2023, during NFT NYC, and the third event will coincide with F1 in Miami on May 5, 2023.

