Repost • @creativoofficial “Sandra Hsu is a Los Angeles based watercolor artist. She specializes in portraiture, fashion illustration and abstract work.
In 2021, along with Marcus Kan of Draw a Dot @drawadot and two other Asian artists, Sandra co- founded Share Your Asian Story (SYAS), an Instagram account focused on telling Asian stories to fight anti-Asian racism. On a bi- weekly basis, Sandra invites guests from the Asian diaspora to talk about the experience of living in a place and culture disparate from their own. The portraits she created of these guests comprise the Share Your Asian Story collection.
In her personal work, Sandra is fascinated with investigating the endless possibilities of watercolor. Her Zodiac and Splash portrait collections fuse free-flowing, abstract splashes of color with realistic elements to tell dynamic stories”

