It’s AAPI Heritage Month, and Share Your Asian Story is kicking it off in style with our in-person event Dreams of the Dragon LA tomorrow, May 2nd, 2023! 🐉❤️💛🧡

This official City of LA AAPI Heritage Month event is cohosted by @shareyourasianstory and @creativoofficial and features these talented visual artists and performers:

@sandrahsuart - watercolor artist
@beck_lines - digital art and NFT
@the_illustrienne - painter and illustrator 
@sketchpoetic - multimedia artist and NFTs
@june_redthread - sculptures, NFTs and AI art
@midnight.painter - multi-media artist
@becmorris - dancer, choreographer, creative director
@xoxo_weiwei - music artist
@jahnny.lee - filmmaker and NFT artist 

Come and celebrate Asian creativity with us! And make sure you follow @shareyourasianstory and @creativoofficial for event updates!

