One week later and we’re still Dreaming of the Dragon. Our first ever AAPI Heritage Month event with @creativoofficial was better than our wildest dreams. We are beyond grateful to all the artists, sponsors, producers and guests who made Dreams of the Dragon a night to remember. Thanks to all of you, Dreams of the Dragon will be an annual event celebrating and supporting AAPI artistry. See you next year!🐲❤️💛🧡

